import React, { Component } from 'react';
import './button-styles.css';

class Button extends Component {
  isOperator = value => {
    return !isNaN(value) || value === '.' || value === '=';
  };
  render() {
    return (
      <div
        style={{ width: '100px', height: '100px' }}
        className="~"
      >
        {this.props.children}
      </div>
    );
  }
}

export default Button;
